import React from 'react';

class GetStartedBtn extends React.Component {
    render(){

        const getStartedBtnStyle = {
            background:'#4BD575',
            "&:hover": {
                background: "#efefef"
              }
        }
        return(
            <button style={getStartedBtnStyle}>Get Started</button>        
            )
    }
}

export default GetStartedBtn;
